('C1', 'WSQ Basic Food Hygiene Course', 2, NULL, NULL, 1, 3, 'The Food & Beverage Workforce Skills Qualification (WSQ) system was launched on 12 July 2006 by the Workforce Development Agency (WDA) as the national qualifications system for the F&B industry. NEA has aligned the teaching and assessment of the Basic Foo', 0, 7, 'CRS-Q-0025989-FB FB-RM-102C-1', 'FB-RM-102C-1', 'WSQ Food Hygiene   Course SOAs', 0, 0, 0, 0, 0, 10, 200, 5),
