('C3', 'Enhanced Construction Safety Orientation Course (ECSOC)', 1, NULL, NULL, 3, 4, ' Legal Obligation\n- Fire and Explosion Hazards\n- Fires and Explosion\n- Specialised Operations\n- Material Handling\n- Mechanical and Electrical Works\n- Working At Height\n- Working in Confined Space\n- Personal Protective Equipment\n- Well Being\n- A', 0, 7, 'CRS-Q-0025990-FB FB-RM-102C-1', 'FB-RM-102C-1', 'WSQ Food Hygiene Course SOAs', 200, 0, 0, 0, 0, 10, 200, 5),
