('C5', 'Apply Workplace Safety and Health in Process Plant', 1, NULL, NULL, 5, NULL, 'Relevant Job Roles/Occupations\n- Workers\n- Foremen\n- Supervisors\n- Technicians\n- Engineers\n- Managers\nTo induct employees on the safety regulations, hazards and responsibilities within the Oil and Petrochemical Industry and highlight the precautions that ', 1, 7, '', '', '', 0, 0, 0, 0, 0, 0, 0, NULL),
('C6', 'Supervise Work in Confined Space Operation', 1, NULL, NULL, 6, NULL, ' Comply with workplace safety and health legislations, guidelines and code of practice and provide inputs for risk assessment\n\n- Identify hazards and control measures\n\n- Comply with safety and health management system\n\n- Implement a permit-to-work system\n', 1, 7, '', '', '', 0, 0, 0, 0, 0, 0, 0, NULL),
('C7', 'Develop a Risk Management Implementation Plan (bizSAFE Level 2)', 1, NULL, NULL, 7, NULL, 'How to form a Risk Management team\n\n- Role and responsibilities of line functions in Risk Management\n\n- Hazard identification methods\n\n- Risk Evaluation\n\n- Implementing Control Measures\n\n- Communication of control measures implemented\n\n- Review effectiven', 1, 7, '', '', '', 0, 0, 0, 0, 0, 0, 0, NULL),
('C8', 'Shipyard Safety Supervisors Course (SSSC)', 1, NULL, NULL, 8, NULL, 'An Overview of Workplace Safety and Health Legislation\n\n- General Safety in Shipyard\n\n- Confined Space Entry\n\n- Hot Works\n\n- Electrical Hazards\n\n- Surface Treatment\n\n- Material Handling\n\n- Working At Height\n\n- Risk Assessment\n\n- Occupational Health\n\n- Acc', 1, 7, '', '', '', 0, 0, 0, 0, 0, 0, 0, NULL),
('C8', 'Building Construction Supervisors Safety Course', 1, NULL, NULL, 9, NULL, 'Roles and duties of Site Personnel in Safety and Health\n\n- Safety Planning and Organisation\n\n- An overview of Workplace Safety and Health Legislations\n\n- WSH (Construction) Regulations\n\n- Work At Height\n\n- Demolition, Excavation and Piling\n\n- Mechanical a', 1, 7, '', '', '', 0, 0, 0, 0, 0, 0, 0, NULL),
('C9', 'Work-At-Height for Workers', 1, NULL, NULL, 10, 5, 'WSH Act, WAH & RM regulations\n\n- Codes of Practice, ACOP and Singapore Standards\n\n- Hazard identification for WAH, fall control measures\n\n- Fall Protection\n\n- Fall Prevention', 0, 7, 'CRS-Q-0024563-PI PI-PRO-110E-1', 'PI-PRO-110E-1', 'Indusctry and Generic Skills SOAs', 0, 0, 0, 0, 0, 10, 200, 0),
