('C11', 'Shipyard Safety Instruction Course (SSIC)', 1, NULL, NULL, 12, NULL, 'Legal Obligation\n\n- Fire and Explosion Hazards\n\n- Prevention of Fires and Explosion\n\n- Preventive Measures for Specialised Operations\n\n- Preventive Measures for Material Handling\n\n- Preventive Measures for Mechanical and Electrical Works\n\n- Preventive Mea', 1, 7, '', '', '', 0, 0, 0, 0, 0, 0, 0, NULL),
('C13', 'Work-At-Height for Supervisors', 1, NULL, NULL, 14, 7, '  Identify the various Workplace Safety & Health (WSH) legislations / Codes of practice / approved codes of practice /\n Singapore standards applicable to WAH\n- Conduct risk assessment on safety & health hazards and implement preventive measures related to', 0, 7, 'CRS-Q-0024565-PI', 'PI-PRO-111E-1', 'Industry and Generic Skills SOAs', 0, 0, 0, 0, 0, 0, 0, NULL),
('C14', 'Double Your Confidence & Self Esteem - Complete Blueprint', 2, NULL, NULL, 15, NULL, 'Confidence is one of the core principles of happiness. And fear is one of the primary obstacles to confidence. Confidence is proven to reduce stress and anxiety, and also improve one’s ability to think clearly and make everyday decisions. This course is d', 1, 7, '', '', '', 0, 0, 0, 0, 0, 0, 0, NULL),
('C15', 'Craft Beer at Home - How to Brew Your First Beer', 2, NULL, NULL, 16, NULL, 'Many times while tasting a flight of beer at a local brewery, I’ve thought to myself “hmm… if this was a little more hoppy or a little more full bodied” – I always felt like I could improve on that beer but I didn’t know how to brew. The truth was… I was ', 1, 7, '', '', '', 0, 0, 0, 0, 0, 0, 0, NULL),
('C16', 'New Manager Training for Developers', 2, NULL, NULL, 17, NULL, 'Whether you have already gotten your first promotion into management, are working toward it, or are just considering making the move, this course will teach you what you need to succeed in the role. This course focuses on both the hard skills and soft ski', 1, 7, '', '', '', 0, 0, 0, 0, 0, 0, 0, NULL),
('C17', 'Triple Your Udemy Course Sales in 2015 - Promotion Secrets', 2, NULL, NULL, 18, NULL, 'Everything has changed in 2015..Udemy has updated its algorithm and the competition is higher than it has ever been... So many instructors are promoting their courses outside of Udemy and they are making a lot of money in 2015...:-)', 1, 7, '', '', '', 0, 0, 0, 0, 0, 0, 0, NULL),
('C18', 'Jane Austen: A Beginner''s Guide to Three Classic Novels', 2, NULL, NULL, 19, NULL, 'Over 27 lectures and 1.5 hours of content!\nUnderstand the basic storyline in three of Jane Austen''s most popular novels\nBe well-prepared to read these three novels with confidence\nUnderstand the major characters and themes in these three novels\nHave more ', 1, 7, '', '', '', 0, 0, 0, 0, 0, 0, 0, NULL),
('C19', 'Mobile app store optimization, marketing, SEO & monetization', 2, NULL, NULL, 20, NULL, 'Website that helps apps raise money\nOverview of raising money for an app\nThree great launch strategies for your app\nReskinning apps: how to get downloads and make money\nHow to compete for competitive app store search terms\n* OVER 3,500 DELIGHTED STUDENTS ', 1, 7, '', '', '', 0, 0, 0, 0, 0, 0, 0, NULL),
('C20', 'Motivation and inspiration: how to inspire your team', 2, NULL, NULL, 21, NULL, 'In this course you will learn strategies to motivate your team and employees to achieve faster results and to want to perform at their best.\nYou will learn psychological and emotional strategies to get your team to buy into your greater vision and get beh', 1, 7, '', '', '', 0, 0, 0, 0, 0, 0, 0, NULL),
