INSERT INTO `ctms_questions` (`question_id`, `question`, `qt_id`, `lang_id`, `default_mark`, `suggested_answer`, `deleted`) VALUES
(1, 'Question 1 of CE1 - practice good personal hygiene in English', 1, 1, NULL, NULL, 0),
(2, 'Candidate is able to practice good personal hygience in English', 2, 1, NULL, '<ul >\n<li>Washing hands thoroughly with soap and water aligned to HPB''s procedures:</li>\n</ul>\n <ol >\n<li>wetting hands with running water</li>\n<li>applying soap onto palm of one hand</li>\n<li>rubbing hands together to make a lather</li>\n<li>rinsing hands thoroughly with running water</li>\n<li>drying hands thoroughly with paper towel</li>\n</ol>', 0),
(3, 'Candidate is able to observe good personal hygiene habits (English)', 2, 1, NULL, '<ol >\n<li>Wearing clearn clothes and apron (PPE) (English)</li>\n<li>Facing the mrror, candidate checkes</li>\n<ul>\n<li>hair is neat and tidy</li>\n<li>tyding hair back for candidates with long hair</li>\n</ul>\n<li>Keeping figernails short and clean</li>\n<li>Not wearing nail polish, artificial fingernails and accessories</li>\n</ol>', 0),
(4, 'Candidate can able to use safe and wholesome food ingredient (English)', 2, 1, NULL, '<ul >\n<li>Reading label on food packaging to check self life / best-before date / date of preparation (English)</li>\n<li>Select ingredient labeled with earlier date</li>\n<li>Inspecting ingredients to ensure they are not spoilt or contaminated</li>\n</ul>', 0),
(5, 'Candidate is able to clean and wash the food', 2, 1, NULL, '<ul >\n<li>Rinsing ingredients in water thoroughly (where applicable) (English)</li>\n<li>Checking ingredients are properly cleaned and washed before use</li>\n</ul>', 0),
(6, 'If you have a cut on your hand, what should you do?', 3, 1, NULL, '<p><span >Cover with brightly-covered waterproof dressing</span></p>', 0),
(7, 'What are the sign of food spoilage?', 3, 1, NULL, '<ul >\n<li>Change in odour</li>\n<li>Smily</li>\n<li>Change in colour (discolouration)</li>\n<li>Souring</li>\n<li>Gas production</li>\n</ul>', 0),
(8, 'For practical reasons, this portion of PC will be assessed using MCQ', 3, 1, NULL, '', 0),
(9, 'State two (2) places where food preparation CANNOT be carried out', 3, 1, NULL, '<ul >\n<li>On the floor</li>\n<li>Near the toilet</li>\n<li>By the drain</li>\n</ul>', 0),
(10, 'Why must you use separate chopping, boards, knives, utensils and crockery use to handle raw and ready-to-eat food?', 3, 1, NULL, '<ul >\n<li>To prevent cross-contamination</li>\n<li>To prevent transfer of germs from raw to ready-to-eat food</li>\n</ul>', 0),
(11, 'Why must food handlers observe good personal hygiene ', 1, 1, NULL, NULL, 0),
(12, 'When you are sick with diarrhea and/or vomiting........ ', 1, 1, NULL, NULL, 0),
(13, 'Which of the following is a good personal hygiene practice to prevent from foodhome illness?', 1, 1, NULL, NULL, 0),
(14, 'Which of the following is the CORRECT way to clean your hands after handling raw food?', 1, 1, NULL, NULL, 0),
(15, 'Which of the following personal hygiene is INCORRECT?', 1, 1, NULL, NULL, 0),
(16, 'Why is it important to use food items from approved sources?', 1, 1, NULL, NULL, 0),
(17, 'Which of the following is INCORRECT?', 1, 1, NULL, NULL, 0),
(18, 'Which of the following is INCORRECT way to defrost frozen food to contamination ', 1, 1, NULL, NULL, 0),
